import Head from 'next/head';
import NavBar from '../components/navBar'


const Layout = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
            <link rel="stylesheet"
            href ="https://bootswatch.com/4/journal/bootstrap.min.css"/>
        </Head>
        <NavBar/>
        {props.children}
    </div>
);

export default Layout;
